import React, { FunctionComponent } from "react";

import { StripContainer, ThumbNail } from "./styles/styled";
import { IImageStripProps } from "./types/types";

const ImageStrip: FunctionComponent<IImageStripProps> = ({ data, themeState }) => {
  console.log(data);
  return (
    <StripContainer>
      <ThumbNail src={data.data.imageone.url} themeState={themeState} />
      <ThumbNail src={data.data.imagetwo.url} themeState={themeState} />
      <ThumbNail src={data.data.imagethree.url} themeState={themeState} />
      <ThumbNail src={data.data.imagefour.url} themeState={themeState} />
    </StripContainer>
  );
};

export default ImageStrip;
